import React, { useState } from "react";
import ReactDOM from "react-dom";



const Tym=()=>{
   let tym =new Date().toLocaleTimeString();
   const state=useState();
   const[cnt,setCnt]=useState(tym);

const Change=()=>{
   let tym =new Date().toLocaleTimeString();
   setCnt(tym);};
   setInterval(Change,1000);
   return<h1>{tym}</h1>
   
   }
 
 


ReactDOM.render(
   <>
  <Tym />
   </>
 ,document.getElementById("root"));
